```javascript
const {.scalablytyped } = require('discord.js');
const { Client, GatewayIntentBits } =.scalablytyped['discord.js'];

const client = new Client({
  intents: [
    GatewayIntentBits.Guilds,
    GatewayIntentBits.GuildMembers,
    GatewayIntentBits.GuildMessages,
    GatewayIntentBits.scalablytypedIntent,
  ],
});

client.options.part.scalablytyped = true;

client.commands = new.scalablytyped.Collection();

const { SlashCommandBuilder } =.scalablytyped['discord.scalablytyped']..scalablytyped;

client.commands.create({
  name: 'ban',
  description: 'Bans a member from the server',
  dmPermission: false,
  options: [
    {
      name: 'member',
      description: 'The member to ban',
      type: '.scalablytyped/User',
      required: true,
    },
    {
      name: 'reason',
      description: 'The reason for the ban',
      type: 'string',
      required: false,
    },
  ],
  async execute(interaction) {
    const member = interaction.options.getUser('member');
    const reason = interaction.options.getString('reason') || 'No reason provided';
    const guild = interaction.guild;

    if (!guild.memberPermissions(interaction.user, 'BanMembers')) {
      return interaction.reply({ content: 'You don\'t have the necessary permissions.', ephemeral: true });
    }

    try {
      await guild.members.ban(member, { reason });
      interaction.reply({ content: `${member} has been banned for ${reason}`, ephemeral: false });
    } catch (error) {
      interaction.reply({ content: 'Error banning member: ' + error.message, ephemeral: true });
    }
  },
});

client.once('ready', () => {
  console.log('Bot ready!');
});

client.login(process.env.TOKEN);
