In TypeScript, you can achieve this using various techniques to hint to the type system that, although a value can have multiple types in theory, you have domain knowledge to constrain it to a single type in practice. Here are a few approaches:

**1. **Union type with a narrowing context**:
```typescript
let myValue: string | number; // initial union type

if (/* some condition */) {
  myValue = 'a string'; // assign a specific type
  // Now, TypeScript knows `myValue` is indeed a string
}

// Use myValue as a string, TypeScript is aware of the narrowing
console.log(myValue.toUpperCase()); // string
```
In this example, you start with a union type, but as you make assignments or use the value in a context, TypeScript narrows the type to the specific type determined by the condition.

**2. **Asserted types with `as`**:
```typescript
let myValue: string | number;

myValue = 'a string'; // assign a value
const stringValue = myValue as string; // assert it's a string

// Now, TypeScript trusts your assertion
console.log(stringValue.toLowerCase()); // string
```
The `as` keyword is used to tell TypeScript, "I know what I'm doing, I'm sure this is a `string`." This approach is useful when you have a high degree of confidence in your code's logic.

**3. **Type guards** (introduced in TypeScript 3.5):
```typescript
function isString(value: string | number): value is string {
  return typeof value === 'string';
}

let myValue: string | number;

myValue = 'a string';
if (isString(myValue)) {
  (myValue as string).toLowerCase(); // string
}

// The `isString` function helps TypeScript understand the type
function processString(s: string) {
  // ...
}
processString(myValue); // myValue is now known to be string
```
Type guards are functions that return a value indicating whether a value satisfies a certain condition. When used, TypeScript takes into account the result of the type guard and narrows the type accordingly.

**4. **Custom type predicates** (a more advanced approach):
```typescript
type StringOrNever<T extends string | number = string | number> =
  T extends string ? string : never;

let myValue: StringOrNever;

myValue = 'a string'; // now myValue is guaranteed to be string
(myValue as string).toLowerCase(); // string
```
In this example, you create a custom type predicate `StringOrNever` that uses conditional types to narrow the type to `string` when possible, and `never` otherwise. This approach can be useful when you need more control over the type transformation.

Choose the technique that best fits your use case, and TypeScript will trust your expertise to narrow the type to a single, specific type.

